import React, { useEffect, useState } from "react";

export default function States({ selectedState, onSelectState, onBack }) {
  const [places, setPlaces] = useState([]);
  const [loading, setLoading] = useState(true);
  const [selectedPlace, setSelectedPlace] = useState(null);

  useEffect(() => {
    fetchPlaces();
  }, [selectedState]);

  async function fetchPlaces() {
    setLoading(true);
    try {
      const url = selectedState
        ? `http://localhost:8000/places?state=${selectedState}`
        : "http://localhost:8000/places";
      const res = await fetch(url);
      const data = await res.json();
      setPlaces(data);
    } catch {
      console.error("Failed to load places");
    } finally {
      setLoading(false);
    }
  }

  if (selectedPlace) {
    return (
      <div style={detailBox}>
        <button style={backBtn} onClick={() => setSelectedPlace(null)}>
          ‚Üê Back
        </button>
        <h1 style={{ color: "#e53935" }}>{selectedPlace.name}</h1>
        <img
          src={`http://localhost:8000/uploads/${selectedPlace.image}`}
          alt={selectedPlace.name}
          style={detailImg}
        />
        <p style={{ marginTop: "15px" }}>{selectedPlace.description}</p>
        <p style={{ color: "#555" }}>üìç {selectedPlace.state}</p>
      </div>
    );
  }

  return (
    <div style={container}>
      <div style={header}>
        {selectedState ? (
          <>
            <button style={backBtn} onClick={onBack}>
              ‚Üê All States
            </button>
            <h2>{selectedState}</h2>
          </>
        ) : (
          <h2>All States</h2>
        )}
      </div>

      {loading ? (
        <p>Loading places...</p>
      ) : places.length === 0 ? (
        <p>No places found for {selectedState || "any state"}.</p>
      ) : (
        <div style={grid}>
          {places.map((p) => (
            <div
              key={p.id}
              style={card}
              onClick={() => setSelectedPlace(p)}
            >
              <img
                src={`http://localhost:8000/uploads/${p.image}`}
                alt={p.name}
                style={img}
              />
              <div style={cardContent}>
                <span style={tag}>{p.state}</span>
                <h3>{p.name}</h3>
                <p style={desc}>
                  {p.description?.slice(0, 60) || "No description"}...
                </p>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}

/* ---- STYLES ---- */
const container = {
  padding: "20px",
};

const header = {
  display: "flex",
  alignItems: "center",
  justifyContent: "space-between",
  marginBottom: "20px",
};

const grid = {
  display: "grid",
  gridTemplateColumns: "repeat(auto-fit, minmax(260px, 1fr))",
  gap: "20px",
};

const card = {
  background: "white",
  borderRadius: "12px",
  overflow: "hidden",
  boxShadow: "0 4px 12px rgba(0,0,0,0.15)",
  cursor: "pointer",
  transition: "transform 0.2s",
};

const img = {
  width: "100%",
  height: "160px",
  objectFit: "cover",
};

const cardContent = {
  padding: "15px",
  textAlign: "left",
};

const tag = {
  display: "inline-block",
  background: "#e53935",
  color: "white",
  padding: "3px 8px",
  borderRadius: "5px",
  fontSize: "12px",
  marginBottom: "8px",
};

const desc = {
  color: "#666",
  fontSize: "14px",
};

const backBtn = {
  background: "#e53935",
  color: "white",
  border: "none",
  borderRadius: "6px",
  padding: "6px 10px",
  cursor: "pointer",
  marginRight: "10px",
};

const detailBox = {
  textAlign: "center",
  padding: "30px",
};

const detailImg = {
  width: "70%",
  maxWidth: "600px",
  borderRadius: "12px",
  marginTop: "20px",
  boxShadow: "0 4px 10px rgba(0,0,0,0.2)",
};
